import './App.css';
import NavBar from './components/NavBar.js';
import { Button, Alert } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <NavBar />
      <p>Welcome to Statify! Here you can view your top most played songs, artists, and genres from various periods of time. Think of it as a Spotify Wrapped that you can access at any time during the year. Just log in and you're all set!</p>
      <Button variant='Primary' className="btn-primary">Login</Button>
    </div>
  );
}

export default App;
